import React from "react";
import NavBar from "./NavBar";

import TrendingMovieNow from "./TrendingMovieNow";
import TrendingTvNow from "./TrendingThisWeek";

const Home = () => {
  return (
    <div className="">
      <NavBar />
      <TrendingMovieNow />
      <TrendingTvNow />
    </div>
  );
};

export default Home;
